import React from 'react';
import gondola from '../assets/works/poetry/gondola-hhr/HHR2.pdf';
import onceManyTimes from '../assets/works/poetry/new-forum-once-many-times/NewForum_OnceManyTimes.pdf';
import rabbit from '../assets/works/poetry/new-forum-rabbit/NewForum_Rabbit.pdf';

const POETRY = [
  {
    title: "Okinawa",
    publication: "The Windsor Review",
    year: "2021",
    url: "https://ojs.uwindsor.ca/index.php/windsor_review/issue/view/694/204",
    excerpt: <span>We flew to Okinawa for the weekend.<br />I let you drive on the other side</span>
  },
  {
    title: "Thinking of Him While Painting My Nails “Mademoiselle” Pink",
    publication: "NōD Magazine",
    year: "2021",
    url: "https://nodmagazine.wordpress.com/",
    excerpt: <span>If I went to France today, would I be <br />called mademoiselle?</span>
  },
  {
    title: "Notes on Mirtazapine",
    publication: "NōD Magazine",
    year: "2021",
    url: "https://nodmagazine.wordpress.com/",
    excerpt: <span>I used to think about death, now I think about donuts.</span>
  },
  {
    title: "Once Many Times",
    publication: "New Forum",
    year: "2021",
    url: onceManyTimes,
    excerpt: <span>I walk one thousand steps one thousand times one thousand</span>
  },
  {
    title: "You are the Man and I am the Rabbit",
    publication: "New Forum",
    year: "2021",
    url: rabbit,
    excerpt: <span>on the moon. Two shapes</span>
  },
  {
    title: "New Moon",
    publication: "Humana Obscura",
    year: "2021",
    url: "https://issuu.com/humanaobscura/docs/humanaobscura_issue2_digital/124",
    excerpt: <span>Look up</span>
  },
  {
    title: "Kobe City",
    publication: "Juniper",
    year: "2021",
    url: "https://juniperpoetry.com/kobe-city-by-mormei-zanke/",
    excerpt: <span>We took a funicular ride up the mountains<br/>behind Kobe City, hoping to see infinity</span>
  },
  {
    title: "Gondola",
    publication: "The Hart House Review",
    year: "2017",
    url: gondola,
    excerpt: <span>The Earth expands while I remain<br/>small.</span>
  },
  {
    title: "What Colour is That?",
    publication: "The Maynard",
    year: "2016",
    url: "https://www.themaynard.org/Vol9No2/WhatColourisThat.php",
    excerpt: <span>You point to a cloud<br/>on the horizon.</span>
  },
  {
    title: "12:33 AM",
    publication: "The Maynard",
    year: "2016",
    url: "https://www.themaynard.org/Vol9No2/1233AM.php",
    excerpt: <span>We wait for buses<br/>at stops opposite<br/>each other.</span>
  }

]

export default POETRY;
